import logo from './trivia.png';
// import './App.css';

export default function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={ logo } width='300px' className="App-logo" alt="logo" />
        <p>SUA VEZ</p>
      </header>
    </div>
  );
}
